import React from "react";
import {
  Container,
  Text,
  SubHeader,
  Input,
  PrimaryButton,
  SubText,
  ActionButton
} from "../styledComponents";
import styled from "styled-components";
import { device } from "../../lib/deviceSize";
import hasLogo from "../../public/static/HAS.png";

const ImgWrapper = styled(Container)`
  flex-direction: column;
  flex: 0.65;
  padding-top: 50px;
  padding-left: 60px;
  padding-right: 10px;

  background-color: ${({ theme }) => theme.btnPrimary};
  min-height: 100%;
  max-height: 100%;
`;
const FormWrapper = styled(Container)`
  flex-direction: row;
  flex: 0.35;
  min-height: 100%;
  max-height: 100%;
`;
const Form = styled.form`
  display: flex;
  flex-direction: column;
  width: 100%;
  padding: 50px;
  justify-content: center;
  flex: 1;
`;

const Login = () => {
  return (
    <Container
      flex={1}
      color="red"
      row
      customStyles={{ minHeight: "100vh", maxHeight: "100vh" }}
    >
      <ImgWrapper>
        <Container flex={false} row center color="transparent">
          <img
            src={hasLogo}
            style={{ width: "50px", height: "50px", marginRight: "10px" }}
          />
          <Text customStyles={{ color: "white" }}>House-Assist Space</Text>
        </Container>
      </ImgWrapper>
      <FormWrapper>
        <Form>
          <SubHeader customStyles={{ fontWeight: "500", marginBottom: 10 }}>
            Login
          </SubHeader>
          <Text>Welcome back, log in to see the latest data!</Text>
          <fieldset
            style={{
              display: "flex",
              padding: "30px 0px",
              border: "none",
              flexDirection: "column"
            }}
          >
            <Input label="EMAIL" placeholder="eg: name@example.com" />
            <Input type="password" label="PASSWORD" />
          </fieldset>
           <ActionButton>Forgot our password</ActionButton>
          <PrimaryButton>Login</PrimaryButton>
        </Form>
      </FormWrapper>
    </Container>
  );
};

export default Login;
